import Link from 'next/link';

const Foot = () => (
  <div id="footer">
    <ul>
      <li><Link href="/"><a>- Home</a></Link></li>
      <li><Link href="/contact"><a>- Get In Touch</a></Link></li>
      <li><Link href="/about"><a>- Learn About Us</a></Link></li>
    </ul>
    <div id="acreditations">
      <ol>
        <li>Website Author: <a>Will Forte</a></li>
        <li>Powered By: <a>React</a></li>
      </ol>
    </div>
    <style jsx>{`
      #footer {
        float: left;
        width: 80%;
        background: rgba(0,0,0,.4);
        padding: 10%;
      }
      ul {
        float: left;
        width: 40%;
      }
      ol {
        float: left;
        width: 40%;
        border: 1px solid black;
      }
      ol li {
        float: left;
        width: 100%;
      }
      ol li a {
        width: 40%;
        padding: 5%;
        margin: 0;
        float: right;
      }
      li {
        float: left;
        width: 100%;
        color: white;
      }
      li a {
        border-bottom: 2px solid rgba(0,0,0,0);
      }
      li a:hover {
        color: rgba(255,255,255,.6);
        background: none;
        border-bottom: 2px solid #FF6161;
      }

/*  ||||| Mobile device display properties only |||||  */

      @media only screen and (max-device-width: 480px) {
        ul {
          float: left;
          width: 100%;
          position: relative;
          background: none;
        }
        li {
          float: left;
          width: 100%;
        }
        li a {
          float: left;
        }
      }
      `}</style>
  </div>
);

export default Foot;
